<style>
  html, body { height: 100%; width: 100%; margin: 0; padding: 0; }

  /* Folium/Leaflet map container(s) */
  .folium-map, div[id^="map_"] { height: 100vh !important; width: 100vw !important; }
  
  /* Hide things on phones */
.desktop-only { display: block; }
@media (max-width: 768px){
  .desktop-only { display:none !important; }
}

  /* ‚Äúcard‚Äù style overlay */
  .map-card{
    position: fixed;
    z-index: 9999;
    background: rgba(255,255,255,0.85);
    backdrop-filter: blur(6px);
    border-radius: 14px;
    box-shadow: 0 10px 25px rgba(0,0,0,0.18);
    border: 1px solid rgba(0,0,0,0.08);
    padding: 10px 12px;
    font-family: Arial, sans-serif;
  }

  /* Title */
  .map-title{
    top: 10px;
    left: 50%;
    transform: translateX(-50%);
    max-width: min(92vw, 520px);
    text-align: center;
  }
  .map-title h3{ margin: 0; font-size: 18px; line-height: 1.15; }

  /* Legend (collapsible with <details>) */
  .map-legend{
    top: 70px;
    right: 10px;
    max-width: min(60vw, 360px);
    font-size: 12px;
  }
  .map-legend summary{ cursor: pointer; font-weight: 700; }

  /* Charts panel (desktop) */
  .chart-panel{
    top: 70px;
    left: 10px;
    width: 190px;
  }

  /* ‚ÄúFAB‚Äù button for mobile to toggle charts */
  .fab{
    position: fixed;
    left: 14px;
    bottom: 14px;
    z-index: 10000;
    border: none;
    border-radius: 999px;
    padding: 12px 14px;
    box-shadow: 0 10px 25px rgba(0,0,0,0.25);
    background: rgba(255,255,255,0.92);
    font-weight: 700;
  }

  /* Modal for charts (works on iOS/Android; avoids pop-up blockers) */
  #chart-modal{
    display:none;
    position: fixed;
    inset: 0;
    z-index: 20000;
    background: rgba(0,0,0,0.65);
    padding: 12px;
  }
  #chart-modal .inner{
    height: 100%;
    width: 100%;
    background: rgba(255,255,255,0.98);
    border-radius: 14px;
    overflow: auto;
    position: relative;
    display:flex;
    align-items:center;
    justify-content:center;
  }
  #chart-modal img{
    max-width: 100%;
    max-height: 100%;
    height: auto;
    width: auto;
  }
  #chart-modal .close{
    position: absolute;
    top: 8px;
    right: 10px;
    border: none;
    border-radius: 10px;
    padding: 8px 10px;
    font-weight: 800;
  }
                                  
                                  .market-watermark{
  position: fixed;
  top: 80px;
  right: 200px;
  z-index: 9999;
  padding: 2px;
}
.market-watermark img{
  width: 225px;
  height: auto;
  opacity: 0.9;
}

.personal-watermark{
  position: fixed;
  bottom: 20px;
  right: 45px;
  z-index: 9999;
}
.personal-watermark img{
  width: 200px;
  height: auto;
}

/* Phone overrides */
@media (max-width: 768px){
  .market-watermark{ top: 70px; right: 10px; }
  .market-watermark img{ width: 140px; }
  .personal-watermark{ bottom: 10px; right: 10px; }
  .personal-watermark img{ width: 120px; }
}


  /* Mobile tweaks */
  @media (max-width: 768px){
    .chart-panel{ display:none !important; }
    .map-title h3{ font-size: 16px; }
    .map-legend{ bottom: 14px; top: auto; right: 10px; left: 10px; max-width: 92vw; }
  }

  /* Make LayerControl easier to tap */
  .leaflet-control-layers{ font-size: 14px; }
  .leaflet-control-layers-toggle{ width: 44px !important; height: 44px !important; }
  .leaflet-control-layers-expanded{
  max-height: 60vh !important;
  overflow-y: auto !important;
}
</style>

function openChart(key){
  const src = charts[key] || "";
  if(!src) return;
  document.getElementById("chart-img").src = src;
  document.getElementById("chart-modal").style.display = "block";
}

function closeChart(e){
  if(e.target.id === "chart-modal") {
    document.getElementById("chart-modal").style.display = "none";
    document.getElementById("chart-img").src = "";
  }
}

function forceClose(){
  document.getElementById("chart-modal").style.display = "none";
  document.getElementById("chart-img").src = "";
}

function toggleCharts(){
  const p = document.getElementById("chart-panel");
  if(!p) return;
  p.style.display = (p.style.display === "none" || p.style.display === "") ? "block" : "none";
}
